import { Redirect } from 'react-router-dom'

function Profile() {
  const token = localStorage.getItem('token')

  if(!token) {
    return <Redirect to="" />
  }

  return (
    <div>
      <h1>Profile</h1>
      {/* other profile content */}   
    </div>
  )
}

export default Profile
